ADOBE PHOTOSHOP PLUGINS 

FocalBlade

FocalBlade sharpens photos for display and print, reduces noise
and produces great looking blur, soft focus and special effects.
FocalBlade is ideal for sharpening and enhancing all kinds of
photo, e.g. snapshots, landscapes photos, portraits as well as
high-ISO shots, because it effectively sharpens and reduces noise
at the same time.

